import React, { useState } from 'react';
import { Navbar, Nav, Container, Row, Col, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  const [showProfile, setShowProfile] = useState(false);

  const toggleProfile = () => {
    setShowProfile(!showProfile);
  };

  return (
    <div>
      <header className='bg-light p-3'>
        <Container>
          <Row className='align-items-center'>
            <Col>
              <h1 className='text-center'>Chat App</h1>
            </Col>
            <Col className='text-right'>
              <Navbar expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                  <Nav>
                    <Nav.Link href="#" onClick={toggleProfile}>
                      <i className="bi bi-person-circle"></i> Profile
                    </Nav.Link>
                  </Nav>
                </Navbar.Collapse>
              </Navbar>
            </Col>
          </Row>
        </Container>
      </header>
      <Container className='mt-4'>
        <Row>
          <Col>
            <div>Content of your home page goes here...</div>
          </Col>
          {showProfile && (
            <Col md={3} className='d-flex flex-column align-items-end'>
              <Card className='w-100'>
                <Card.Body>
                  <Card.Title>User Details</Card.Title>
                  <Card.Text>Name: John Doe</Card.Text>
                  <Card.Text>Email: johndoe@example.com</Card.Text>
                </Card.Body>
              </Card>
            </Col>
          )}
        </Row>
      </Container>
    </div>
  );
};

export default Home;
